sys_variable_value.value:
(function execute(inputs, outputs) {
  var search_terms = [];
  var termsList = gs.getProperty("x_snc_covid_svn.external_content.search_terms").split(",");
  for(var item in termsList)
  {
    var search_term = {};
    search_term.term = termsList[item];
    search_terms.push(search_term);
  }

  outputs.search_terms = search_terms;
})(inputs, outputs);

